    function distance4val(x1, y1, x2, y2) {
    const deltaX = x2 - x1;
    const deltaY = y2 - y1;

    return Math.sqrt(deltaX ** 2 + deltaY ** 2);
}

    function sortCoordinatesByDistance(mainPoint, coordinates) {

    const sortedCoordinates = coordinates.sort((coordA, coordB) => {
  
      const distanceA = distance4val(
  
        mainPoint.x,
  
        mainPoint.y,
  
        coordA.x,
  
        coordA.y
  
      );
  
      const distanceB = distance4val(
  
        mainPoint.x,
  
        mainPoint.y,
  
        coordB.x,
  
        coordB.y
  
      );
  
  
  
      return distanceA - distanceB;
  
    });
  
  
  
    return sortedCoordinates;
  
  }

